import React, { Component } from 'react'

class Time extends Component {
    render() {
        return (
            <div className='time'>
                <img src="https://cdn.grofers.com/assets/ui/fresh_icon.png" alt="" />
                <p>Sourced at 5 AM</p>
            </div>
        )
    }
}

export default Time
